import React from 'react';
import {Card} from 'antd';
import Progresses from '../Progresses';

class Card2 extends React.Component {
    render() {
        return (
            <div>
                <Card size="small" style={{ width: 300 }}>
                    <p size="10+">Harvest Progress</p>
                    <Progresses />
                </Card>
            </div>
        );
    }
}

export default Card2;
